import React, { Component } from 'react'

export default class App extends Component {
  render() {
      const title="User App"
      const isAutorized=true;
    return (
      <div>
          <h5>{title}</h5>
          
          {isAutorized ? <p>Autorized</p> : <p>Not Autorized</p>}
      </div>
    )
  }
}
